  static string InitialExercises = @"[{""ID"":1,""ExerciseName"":""Bicycles"",""ExerciseDescription"":""Lie on your back with fingertips behind ears, legs in the air, and knees pulled toward chest. Target your sides and entire ab area by contracting as you lift your shoulder blades off the ground. Straighten your right leg at a 45-degree angle and rotate your upper body to the left, bringing the right elbow toward the left knee. Switch sides by straightening your left leg, bending your right leg, and bringing the left elbow to the right knee. Alternate sides in a pedaling motion. "",""ExerciseImage"":""bicycle.jpg""},{""ID"":2,""ExerciseName"":""Bridges"",""ExerciseDescription"":"" Lie down on your back. Keep your arms at your sides. Lift your hips toward the ceiling. Keep your knees and thighs parallel. Hold the pose for 5 full breaths and release back to the start position."",""ExerciseImage"":""bridge.jpg""},{""ID"":3,""ExerciseName"":""Burpees"",""ExerciseDescription"":""Stand with your feet hip width apart and your arms down by your side. Lower into a squat position with your hands flat on the floor in front of you. Kick your legs backwards into a press up position and lower your chest to the floor. Push your chest back up to the press up position thrust both feet forward so you are back in the squat position. Jump up and raise both hands over your head."",""ExerciseImage"":""burpees.jpg""},{""ID"":4,""ExerciseName"":""Crunches"",""ExerciseDescription"":""Lie flat on your back with your knees bent and feet flat on the floor, hip width apart. Place your hands slightly either side of your head, do not lock your fingers or pull the head up. Push the small of your back into the floor to engage the abdominals. Tilt your chin slightly, leaving a few inches space between chin and chest. Begin to roll your shoulders off the floor. Your shoulders should leave the floor by about 4 inches and your lower back should always remain on the floor. Hold for a moment at the top then slowly move back down."",""ExerciseImage"":""Crunch.png""},{""ID"":5,""ExerciseName"":""Mountain Climbers"",""ExerciseDescription"":""Assume a press up position so your hands are directly under your chest at shoulder width apart with straight arms. Your body should form a straight line from your shoulders to your ankles. Lift your right foot off the floor and slowly raise your knee as close to your chest as you can. Return to the starting position and repeat with your left leg. Continue alternating for the desired number of reps or time."",""ExerciseImage"":""mountainclimbers.jpg""},{""ID"":6,""ExerciseName"":""Jumping Jacks"",""ExerciseDescription"":""Stand with your feet together and your hands down by your side. In one motion jump your feet out to the side and raise your arms above your head. Immediately reverse that motion by jumping back to the starting position."",""ExerciseImage"":""jj.jpg""},{""ID"":7,""ExerciseName"":""High Knees"",""ExerciseDescription"":""Stand straight with the feet hip width apart, looking straight ahead and arms hanging down by your side. Jump from one foot to the other at the same time lifting your knees as high as possible, hip height is advisable. The arms should be following the motion. Touch the ground with the balls of your feet."",""ExerciseImage"":""highknees.png""},{""ID"":8,""ExerciseName"":""High Kicks"",""ExerciseDescription"":"" Reach your right arm straight out in front of you, parallel with the ground. Your hand should be flat with your palm facing the ground. Step forward to put your weight on your left foot and kick your right foot up towards your hand with your toes flexed. You should work towards touching your toes to your palm."",""ExerciseImage"":""frontkick.png""},{""ID"":9,""ExerciseName"":""Lunges"",""ExerciseDescription"":""Place the hands on the hips, pull the shoulders back and stand tall. Step forwards with your right leg and slowly lower the body until the front knee is bent to 90 degrees. The back knee should never touch the floor. Push yourself back up to the starting position as quickly but safely as possible. Repeat with the left leg."",""ExerciseImage"":""lunge.jpg""},{""ID"":10,""ExerciseName"":""Leg Lifts"",""ExerciseDescription"":""Lie flat on your back with your legs stretched out in front of you. Raise your legs. Straighten your legs until your feet are pointed at the ceiling. Slowly lower your legs. Slow it down if this exercise is too easy."",""ExerciseImage"":""leglift.jpg""},{""ID"":11,""ExerciseName"":""Plank"",""ExerciseDescription"":""Get into pushup position on the floor. Now bend your elbows 90 degrees and rest your weight on your forearms. Your elbows should be directly beneath your shoulders, and your body should form a straight line from your head to your feet. Hold the position for as long as you can. Your goal should be to hold it for two minutes."",""ExerciseImage"":""frontplank.jpg""},{""ID"":12,""ExerciseName"":""Plank Jacks"",""ExerciseDescription"":""Start in the plank position but with the elbows bent and the weight resting on the forearms. The body should form a straight line from the shoulders to the ankles. Engage the core by contracting your abs. Jump the feet out to the sides as if you were performing a jumping jack but keep the upper body still. Return the feet to the starting position and that is 1 rep."",""ExerciseImage"":""plankjacks.jpg""},{""ID"":13,""ExerciseName"":""Pull-Ups"",""ExerciseDescription"":""Pull your shoulder blades back as you’re going through the movement, and focus on pulling the bar down. Again, keep your butt clenched and your abs tight throughout the movement. Get your chin above the bar, or it doesn’t count as a full rep."",""ExerciseImage"":""pullups.png""},{""ID"":14,""ExerciseName"":""Push-Ups"",""ExerciseDescription"":""Go into the pushup position. Lower your body keeping your back perfectly flat. Raise your body and repeat."",""ExerciseImage"":""pushups.jpg""},{""ID"":15,""ExerciseName"":""Squats"",""ExerciseDescription"":""Stand tall with your feet hip width apart and your arms down by your side. Start to lower your body back as far as you can by pushing your hips back and bending your knees and pushing your body weight into your heels. As you are lowering into the squat your arms will start to raise out in front of you for balance. Keep a neutral spine at all times and never let your knees go over your toes. The lower body should be parallel with the floor and your chest should be lifted at all times not rounded. Pause then lift back up in a controlled movement to the starting position."",""ExerciseImage"":""squat.png""},{""ID"":16,""ExerciseName"":""Supermans"",""ExerciseDescription"":""Lie face down on your stomach with the arms extended out in front of you and the legs extended behind you. In one movement lift the arms and legs up towards the ceiling making a U shape. Make sure that you do not lock out the limbs and keep the core as still as possible. Hold for 2-5 seconds and lower back down to complete 1 rep."",""ExerciseImage"":""superman.jpg""},{""ID"":17,""ExerciseName"":""Skaters"",""ExerciseDescription"":""Stand on your right foot with you knee slightly bent, place your left foot just behind your right ankle. Lower your body to a squat position, your right arm out to the side and your left arm across your hips. Hop to your left foot by jumping off your right foot, bringing the right foot behind your left foot as you swing your arms to the left to. Repeat the move towards the right."",""ExerciseImage"":""Skaters.png""},{""ID"":18,""ExerciseName"":""Sit-Ups"",""ExerciseDescription"":""Lie on your back with your knees bent and you feet flat on the floor. Place your finger tips behind your ears. Pull your shoulder blades back so your elbows are out to the side. Brace your abs and then raise your body up towards your knees, shoulders should be lifted of the floor. Head always looking straight, no chin on chest and do not pull the head forward. Roll back down to the starting position."",""ExerciseImage"":""situps.jpg""},{""ID"":19,""ExerciseName"":""Russian Twist"",""ExerciseDescription"":""Sit on the floor with your knees bent and your feet flat on the ground. Lean back so your torso is at a 45-degree angle to floor, making sure to keep the spine straight and not rounded. Lace your arms straight out in front of your chest with one hand on top of the other. Raise your core and slowly rotate round to the right as far as you can, pause then reverse this movement all the way round to the left as far as you can. That is 1 rep."",""ExerciseImage"":""russiantwist.jpg""},{""ID"":20,""ExerciseName"":""Tricep-Dips"",""ExerciseDescription"":""Hoist yourself up onto a bench, chair or step as long as it is stable and secure to take your body weight. Hands should be shoulder width apart fingers facing forward and elbows pointing backwards with a slight bend in the elbows. Legs extended out in front of you with a slight bend in the knee. Slowly lower your body until your shoulder joints are below your elbows. Push back up until your elbows are nearly straight but do not lock them out."",""ExerciseImage"":""tricepdips.png""},{""ID"":21,""ExerciseName"":""Walking"",""ExerciseDescription"":""Walk"",""ExerciseImage"":""walk.jpg""},{""ID"":22,""ExerciseName"":""Running"",""ExerciseDescription"":""Run"",""ExerciseImage"":""run.jpg""}]";

#endregion
        
        public static SQLiteConnection DBConnection
        {
            get
            {
                return new SQLiteConnection(
                    new SQLitePlatformWinRT(),
                    Path.Combine(ApplicationData.Current.LocalFolder.Path, "ThesisDB.sqlite"));
            }
        }

        public static void CreateTables()
        {
            string challenges = "";
            string exercises = "";
            //string notifications = "";

            DBConnection.CreateTable<Setting>();
            try
            {
                 challenges = DBConnection.Table<Setting>().Where(x => x.ID == "Challenges").FirstOrDefault().Description;
            }
            catch (Exception)
            {

                if (challenges == "")
                {
                    var result = DBConnection.InsertOrReplace(new Setting() { ID = "Challenges", Description = InitialChallenges });
                }
            }

            try
            {
                exercises = DBConnection.Table<Setting>().Where(x => x.ID == "Exercises").FirstOrDefault().Description;
            }
            catch (Exception)
            {                
                if (exercises == "")
                {
                    var result = DBConnection.InsertOrReplace(new Setting() { ID = "Exercises", Description = InitialExercises });
                }
            }
