        public static async Task Initialize()
        {
            bool DatabaseExists = false;

            try
            {
                StorageFile storageFile = await ApplicationData.Current.LocalFolder.GetFileAsync("ThesisDB.sqlite");
                DatabaseExists = true;
            }
            catch
            {
                DatabaseExists = false;
            }

            if (!DatabaseExists)
            {
                StorageFile databaseFile = await Package.Current.InstalledLocation.GetFileAsync("ThesisDB.sqlite");

                await databaseFile.CopyAsync(ApplicationData.Current.LocalFolder);
            }
        }
    }
